INSERT INTO `uc_abouts` (`id`, `account_id`, `heading`, `description`, `status`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 2, 'About Us', '<p><strong style=\"margin: 0px; padding: 0px; font-family: &quot;Open Sans&quot;, Arial, sans-serif; text-align: justify;\">Lorem Ipsum</strong><span style=\"font-family: &quot;Open Sans&quot;, Arial, sans-serif; text-align: justify;\">&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</span><br></p>', 1, NULL, NULL, NULL),
(2, 3, 'About Us', '<p><span style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\">Establishment in 1967, with the vision of becoming one of the major outfits firm,</span><b style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\">”V.P. Oswal Hosiery Factory”</b><span style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\">&nbsp;is manufacturing and exporting the superior quality&nbsp;</span><b style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\">Winter Wears</b><span style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\">. Among our wide assortment of products, we provide best quality&nbsp;</span><b style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\">Wooden Hand Gloves</b><span style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\">,&nbsp;</span><b style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\">Ladies woolen Scarves</b><span style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\">&nbsp;and&nbsp;</span><b style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\">Men Woolen Scarves.</b><span style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\">Our firm is widely recognized in the market for maximum clientele satisfaction and utilization of modern-age technology thus, making us a prominent in the market. Our broad spectrum of products is much applauded in the market for superior finishing, vivid color combinations and contemporary design patterns. In addition to this, we hold huge appreciation in the market for satisfying the diverse needs of customers by providing them multifarious choices in terms of design patterns and sizes.</span><br style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\"><span style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\">Keeping track of latest market developments, we have implemented a state of art infrastructure facility which includes modernistic manufacturing and quality-inspection unit. Our offered clothes range is fabricated with the use of this unit in varied stipulations as per latest fashion trend. We quality test these products at our quality inspection unit under various parameters in terms of color fastness, shrink resistant, optimal tear strength and vibrant color combinations. In addition to this, we have employed skilled enterprise for serving diversified demands of customers with uttermost perfection. With these prospects, we have earned ourselves huge clientele base in this domain. We export in UAE, Australia etc countries.</span><br style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\"><br style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\"><span style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\">Under the competent guidance of&nbsp;</span><b style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\">Mr. Vijay Kumar Jain</b><span style=\"color: rgb(68, 68, 68); font-family: arial; font-size: 16px; letter-spacing: 0.6px;\">, our firm has become one of the most entrusted names in this domain. With his potent managing and marketing skills, we have achieved reliable growth rate surpassing our competitors.</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br></p>', 1, NULL, NULL, '2020-07-21 06:07:39'),
(3, 4, 'ABOUT US', '<h4>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<b>STEP into&nbsp;RUTBAH DESIGNS!&nbsp;<o:p></o:p></b></h4><p class=\"MsoNormal\"></p><h4><b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(Launched in 2020)</b></h4>\r\n<!--[if !supportLineBreakNewLine]--><p><font face=\"Tahoma\"><br></font></p><p><font face=\"Tahoma\">Step into a world of chic designs and\r\nunique treasures hand-selected for your closet; a world where the hottest\r\ntrends and timeless styles collide to create an unmatched selection of\r\napparels.<br>A woman’s wardrobe is her opportunity\r\nto stand out and make a lasting first impression.&nbsp;RUTBAH\r\nDESIGNS&nbsp;offers a wide range of apparel to fit\r\nany woman<span lang=\"EN-US\" style=\"\">’</span>s\r\nunique sense of style. Our Brand slogan it self speaks&nbsp;\"an Impressive you\"&nbsp;Our\r\nclothing and designer suits are carefully curated to provide our customers the\r\nlatest fashions. To keep our customers in style we post new arrivals daily, as\r\nwell as offer stylist picks to help any indecisive shoppers.&nbsp;RUTBAH DESIGNS&nbsp;is\r\na fashionista’s best place to create the perfect wardrobe.</font></p><p><font face=\"Tahoma\"><br>Beyond helping you look your best,&nbsp;RUTBAH DESIGNS&nbsp;strives\r\nto make every purchase a positive experience. Our top priorities are excellent\r\ncustomer service, exceptionally quick order processing, ultra fast shipping\r\ntimes, and a hassle-free return policy. We value your feedback, whether\r\npositive or constructive and we are continuously working to improve your\r\nexperience.<br></font></p><p><font face=\"Tahoma\"><br>If you are a first-time visitor or long-standing customer, we hope you will be thrilled\r\nwith every aspect of your&nbsp;RUTBAH\r\nDESIGNS&nbsp;shopping experience.<br><br></font></p><p class=\"MsoNormal\"><font face=\"Times New Roman\"><o:p></o:p></font></p><p class=\"MsoNormal\"><font face=\"Times New Roman\"><o:p></o:p></font></p><p class=\"MsoNormal\"><font face=\"Times New Roman\"><o:p></o:p></font></p><p class=\"MsoNormal\"><font face=\"Times New Roman\"><o:p></o:p></font></p><p class=\"MsoNormal\">\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><h5><b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</b>HAPPY SHOPPING !<b style=\"color: inherit; font-family: inherit; font-size: 1.25rem;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</b></h5>', 1, NULL, NULL, '2020-12-08 10:04:23'),
(4, 7, 'ARKO CYCLES', '<section class=\"about-us-custom commenPadding\" id=\"about-csutom\" style=\"position: relative; overflow: hidden; padding-top: 50px; padding-bottom: 50px; font-family: &quot;Squada One&quot;, cursive; font-size: 18px;\"><div class=\"container\" style=\"width: 1079.19px; max-width: 80%;\"><div class=\"row\"><div class=\"col-md-12 col-lg-12 col-xl-10 offset-xl-1\" style=\"width: 899.312px; flex-basis: 83.3333%; max-width: 83.3333%; margin-left: 89.9219px;\"><div class=\"hero-matter text-center\"><p style=\"line-height: 30px;\">Established in 2012 in Ludhiana, Arko Cycles started with manufacturing cycle components slowly paving its way onto becoming the emerging Cycle Brand in India. Today, Arko Cycles is undoubtedly the reputative manufacturer of bicycles in India producing large number of cycles per annum.Starting from a small unit to creating a huge global footprint, Arko Cycles production unit in Ludhiana is fully equipped with an in-house R&amp;D facility producing major bicycle components within its premise under stringent quality parameters complying with all global standards.</p><div><br></div></div></div></div></div></section>', 1, NULL, NULL, NULL),
(5, 8, 'ABOUT US', '<p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\">With its primary interest in the Textile &amp; Apparel sector, Pooja Industries Pvt. Ltd. is firmly rooted in Ethical business practices, building Trust &amp; Commitment with its consumers, and fulfilling its Social Responsibility. Incorporated in 1997, it is a name to reckon with in the national and international markets. Having enjoyed the patronage of consumers pan-India, Pooja Industries Private Limited as a brand has been consistently delivering world-class quality products to its consumers for the past two decades. Apart from a vast dealer network all over India, our customers also include Government departments, Army Schools, and Wet canteens.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 16px;\"><br></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\">Our fabrics include Camouflage, Khaki, Acrylic, Cotton/Polyester, Tweed, Polywool, Spun, Angola, Wool Broadcloth, P/V Tartan Checks. We also manufacture Military T-shirts and Jackets, Army Beret caps, Track Suits, Police Jerseys, and Handloom Products like Mufflers, Scarves &amp; Stoles &amp; Bed Throws. We are open to manufacturing on a Make-to-Order basis and as per the requirement of the buyer.</p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; text-align: justify; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;; min-height: 16px;\"><br></p><p style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; text-align: justify; font-stretch: normal; line-height: normal; font-family: &quot;Helvetica Neue&quot;;\">Factors like rich industry experience, 100% quality control and checks at all stages of production, a deft team of professionals, wide distribution network, rapid order execution, client-centric approach, and prompt deliveries aid the entire process of production of finest fabrics to meet customer satisfaction. With additional after-sales services, our clients can be sure of a seamless experience. A textile powerhouse with state of the art manufacturing infrastructure and best industry practices, we aim to raise the bar of Indian textile manufacturing.</p><div><br></div>', 1, NULL, NULL, NULL);
