(2, 4, 'PRIVACY POLICY', '<p><span style=\"text-align: justify;\"><font color=\"#777777\" face=\"Verdana, Arial, Helvetica, sans-serif\">Protecting your privacy is our primary concern. We have accordingly developed this Privacy Policy to protect your personal information and ensure its confidentiality&nbsp;remains. Our privacy policy is in compliance and in accordance with the laws of various legal jurisdictions wherein there is a place of business. We will take all reasonable efforts and steps in protecting your privacy on the systems and the website controlled by us. We shall not be held accountable with respect to any liabilities or claims or damages which may arise due to any unauthorized usage or unlawful disclosures of your personal and confidential information made by third parties who are not subject to our control, for example advertisers and websites that have links to our Website. Please note that the information and privacy practices of our business partners, advertisers, sponsors or other sites to which we provide hyperlinks, may be different from ours and our obligations do not extend to any third party. Our privacy policy is subject to change, modification, alteration at any time without prior notice to any party. To ensure that you are apprised of any changes made to the privacy policy, you are requested to kindly review the policy along with its terms and conditions periodically.</font></span><br></p>', 1, NULL, NULL, NULL),
(3, 7, 'PRIVACY POLICY', '<h3 style=\"margin-top:0in;margin-right:0in;margin-bottom:7.5pt;margin-left:\r\n0in\"><span style=\"font-size: 19.5pt; font-family: Arial, sans-serif;\">Date of Updation<o:p></o:p></span></h3><h3 style=\"line-height: 1.2; font-size: 26px; margin-top: 0px; color: rgb(0, 0, 0);\">\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">Thank you for visiting\r\nwww.arkocycle.com. We utmost respect your privacy and consider it to be a\r\npertinent element of our business. This privacy policy statement applies to\r\nwww.arkocycle.com&nbsp;only. It does not apply to information collected and\r\nstored by means other than the website.<o:p></o:p></span></p>\r\n\r\n</h3><h3 style=\"margin: 0in 0in 7.5pt;\"><span style=\"font-size: 19.5pt; font-family: Arial, sans-serif;\">Privacy of Personal Information<o:p></o:p></span></h3><h3 style=\"line-height: 1.2; font-size: 26px; margin-top: 0px; color: rgb(0, 0, 0);\">\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">With due respect to the privacy\r\nof its users,&nbsp;<a href=\"https://www.herocycles.com/\" style=\"outline-style: initial; outline-width: 0px; color: var(--sec-color);\">Arko\r\nCycle website</a>,&nbsp;&nbsp;abstains from getting personal information\r\nfrom users without their denotative consent. Arko Cycles does not distribute,\r\nsell or rent any personal information collected via its website. This is also\r\ntrue for personal information (email address, postal address, etc.) sent to the\r\nwebsite\'s email addresses, contact notes. Arko Cycles does not send unsolicited\r\nemails to users of its site and the personal information entered via the site\'s\r\nregistration forms such as, feedback form, complaint form etc., is protected by\r\nsecurity features.<o:p></o:p></span></p>\r\n\r\n</h3><h3 style=\"margin: 0in 0in 7.5pt;\"><span style=\"font-size: 19.5pt; font-family: Arial, sans-serif;\">Policy on Cookies<o:p></o:p></span></h3><h3 style=\"line-height: 1.2; font-size: 26px; margin-top: 0px; color: rgb(0, 0, 0);\">\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">Arko Cycles website studies total\r\nusage data to find out how often and when site content is requested or visited.\r\nIt does not use persistent cookies (text cookies) or session cookies for the\r\npurpose of tracking usage of its site. A persistent cookie, or text cookie, is\r\na file that might contain user information. It is stored on a user\'s computer.\r\nArko Cycles website uses session cookies (session cookies are not stored on a\r\nuser\'s computer).<o:p></o:p></span></p>\r\n\r\n</h3><h3 style=\"margin: 0in 0in 7.5pt;\"><span style=\"font-size: 19.5pt; font-family: Arial, sans-serif;\">Online surveys<o:p></o:p></span></h3><h3 style=\"line-height: 1.2; font-size: 26px; margin-top: 0px; color: rgb(0, 0, 0);\">\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">For better understanding the\r\nneeds and profile of our visitors, we conduct online surveys. When we conduct\r\nthe survey, we will try to let the user know how we shall use said information\r\nat the time of collecting information from the user on the Internet. However\r\nthe same is not obligatory on our part. The user recognizes and understands\r\nthat there is no compulsion on their part to provide us with their personal\r\ninformation and all personal information provided by them to us is with their\r\nfull consent, own will and desire to provide such personal information. They\r\nalso understand that we are under no obligation to verify the source from which\r\nthe personal information about them is provided to us and is deemed to be\r\nprovided by them.<o:p></o:p></span></p>\r\n\r\n</h3><h3 style=\"margin: 0in 0in 7.5pt;\"><span style=\"font-size: 19.5pt; font-family: Arial, sans-serif;\">Links to other websites<o:p></o:p></span></h3><h3 style=\"line-height: 1.2; font-size: 26px; margin-top: 0px; color: rgb(0, 0, 0);\">\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">Arko Cycles website may contain\r\nlinks to other sites and we try to link only those sites that share our high\r\nstandards and respect for privacy. We are not responsible for the content or\r\nthe privacy practices used by other sites.<o:p></o:p></span></p>\r\n\r\n</h3><h3 style=\"margin: 0in 0in 7.5pt;\"><span style=\"font-size: 19.5pt; font-family: Arial, sans-serif;\">Changes to the \"Privacy Statement\"<o:p></o:p></span></h3><h3 style=\"line-height: 1.2; font-size: 26px; margin-top: 0px; color: rgb(0, 0, 0);\">\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">With effect from the future, Arko\r\nCycles reserves the right to change this privacy statement from time to time.\r\nWhen we do, we will also revise the \"Date of Updation\" date at the\r\ntop of this privacy statement. For material changes to this privacy statement,\r\nwe will notify placing a notice on this Web Site.<o:p></o:p></span></p>\r\n\r\n</h3><h3 style=\"margin: 0in 0in 7.5pt;\"><span style=\"font-size: 19.5pt; font-family: Arial, sans-serif;\">Security<o:p></o:p></span></h3><h3 style=\"line-height: 1.2; font-size: 26px; margin-top: 0px; color: rgb(0, 0, 0);\">\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">Arko Cycles endeavours to take\r\nreasonable and appropriate measures to protect your personal information from\r\nunauthorized access or disclosure. However, we do not warrant or represent that\r\nyour personal information is completely safe from hackers and other security\r\nthreats.<o:p></o:p></span></p>\r\n\r\n</h3><h3 style=\"margin: 0in 0in 7.5pt;\"><span style=\"font-size: 19.5pt; font-family: Arial, sans-serif;\">For Facebook &amp; Twitter<o:p></o:p></span></h3><h3 style=\"line-height: 1.2; font-size: 26px; margin-top: 0px; color: rgb(0, 0, 0);\">\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">The contents on the\r\nFacebook/Twitter page/account are for general reference purposes and do not\r\nconstitute any binding commitment or the specifically endorsed views of Arko\r\nCycles Limited (Company). The views expressed by other persons, followers and\r\n3rd parties on this page are individual opinions and the Company does not take\r\nresponsibility for the same.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">Any views, advice and tips\r\nrendered on the page are free of cost based upon general experience and need\r\nnot specifically meet all the requirements of any person, visitor. The views\r\nexpressed are general in nature and require no kind of fees or payment.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">The Company and its operations\r\nincluding the contents of the page are subject to laws of the Republic of India\r\nand related regulations. The conditions of use and all other \'Facebook\' /\r\n\'Twitter\' Terms and Conditions continue to apply in addition to the above.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">All content posted by the Company\r\nincluding but not limited to the software, programming code, media relating to\r\nthe Page, Promotion-related communications, etc. are protected by the\r\napplicable proprietary laws such as copyright law, trademark law, patent law\r\nand competition.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">The Company exclusively reserves\r\nthe right to change or modify the applicable terms and conditions without prior\r\nnotice.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">This page is in not endorsed or\r\nsponsored or administered by, or associated with, Facebook / Twitter.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">The Company reserves the right to\r\nuse information received from any user or 3rd party on the page for its own\r\npurposes including but not limited to brand communication &amp; product\r\ndevelopment.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">Any personal information shared\r\nwith the Company on the page of the Company, whether public or private, shall\r\nnot be sold, exchanged, transferred, or given to any other Company however the\r\nCompany shall have the right to make reference &amp; use of the information for\r\nits own purposes only. All disclosures would be deemed to have given the\r\nCompany the voluntary rights of use by the Company for its own purposes.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">The Company shall maintain\r\nsuitable security measures for the safety of personal information and other\r\ndisclosures when any 3rd person enters, submits, or accesses personal information.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">All disclosures &amp; measures\r\nrequired/necessitated under law, for enforcement of page policies, for protect\r\nCompany\'s interest or others rights, property, or for safety purposes will be\r\ntaken by the Company unilaterally without any obligation towards intimation or\r\ninformation to the 3rd persons or parties.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; fo