ny. In the event that the Company\r\nincurs any loss, harm or damage then the company shall be in right to take\r\nappropriate steps to identify the person(s) involved and seek indemnity and\r\ncompensation for all loss, claim, demand, damage, costs, charges (including\r\nlegal fees and charges) or prejudice that may be caused to the Company on\r\naccount of misuse of the page and the consequent affect upon the Company.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">For any contests or promotions,\r\nthe decision of the Company and the terms and conditions of the specific\r\ncontest/promotion shall be binding on all participants. The Company shall not\r\nentertain any grievance or concerns in this regards and the decision of the\r\nCompany (as resolved under applicable terms and conditions) shall be final and\r\nbinding.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">Acceptance or participation in\r\nthe contest, promotions or other features on the page will constitutes\r\npermission to the Company to use the name, relevant details and/or photographs\r\nand/or likeness for purposes of publicity, advertising and/or trade without any\r\nclaim for compensation or notice.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">Any participant or user or 3rd\r\nparty who is suspected of any illegal act such as hacking, etc would\r\nimmediately dealt with by the Company in the manner as deemed suitable by the\r\nCompany.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">The Company is not making any\r\nwarranties of any kind whatsoever whether express or implied, on this page with\r\nregards meeting of the 3rd party requirements or aspirations, timeliness,\r\nsecurity, uninterrupted-ness, error-free, the results or reliability, or the\r\ndelivery, quality, quantity, merchantability, fitness for use or\r\nnon-infringement in respect of any goods, services, emoluments, benefits or\r\nawards acquired or obtained through the page or any transactions effected\r\nthrough the page.<o:p></o:p></span></p>\r\n\r\n<p style=\"margin-top: 0in;\"><span style=\"font-size: 13.5pt; font-family: Arial, sans-serif;\">Copyright © Arko Cycles Limited,\r\nAll Rights Reserved<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\"><strong><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;\r\nfont-weight:normal\"><o:p>&nbsp;</o:p></span></strong></p></h3>', 1, NULL, NULL, '2020-11-19 11:49:49'),
