(127, 3, 6, 7, 13, '100% PURE WOOL OFF WHITE UPPER HALF-SLEEVE SIZE(46)', 'These off white color thermal wears will make you feel warm in Winters, it will give you so much comfortable and feels you warm and cozy in chilly winters so that you can use it as daily wear in Winters. It is durable and you can wash it in washing machine as well as hand wash also.&nbsp;', 4, 1, NULL, '2020-07-11 10:51:53', '2020-07-25 05:46:48'),
(128, 3, 6, 7, 11, 'Black pure wool socks (One size Gents)', '<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt 13.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,&quot;sans-serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#111111;mso-fareast-language:EN-IN\">Vintage and trendy\r\ndesign warm socks that will coordinate with whatever you\'re wearing. Brighten\r\nup those cold winter mornings with these snuggly socks to keep your toes warm.\r\nEasily match your favorite outfits with these fun colors. These socks come is a\r\nstandard us size that fit shoe sizes from 5 to 10, so everyone can enjoy warm,\r\ntoasty feet.<o:p></o:p></span></p>', 4, 1, NULL, '2020-07-11 10:53:14', '2020-07-28 08:18:00'),
