(20, 8, '3304HG', 'Warm sky Dark Grey Cap', 'The dark grey cap gives the best warmth you won\'t feel cold at all even at -21 degrees.<span style=\"color: rgb(33, 33, 33); font-family: Arial, sans-serif; font-size: 10.5pt;\">The quality is really good\r\nand feels very warm . The finish is so great and the colour is also adorable.\r\nThis is a must buy for winters that you won\'t regret even a bit after buying\r\nit, instead this is a great fashion wear too. The price is also very affordable\r\nwhich makes it purely a value for money product.&nbsp;</span><p class=\"MsoNormal\"><span style=\"font-size: 10.5pt; line-height: 115%; font-family: Arial, sans-serif; color: rgb(33, 33, 33); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p>', 14, NULL, NULL, NULL, NULL, 'https://drive.google.com/uc?export=view&id=1e82NhvO8XLu9PT_UFG52XfepvdeyyXCo', 'https://drive.google.com/uc?export=view&id=1e82NhvO8XLu9PT_UFG52XfepvdeyyXCo', 'https://drive.google.com/uc?export=view&id=1e82NhvO8XLu9PT_UFG52XfepvdeyyXCo', NULL, NULL, NULL, NULL, NULL, 1, 4, 1, 1, NULL, '2020-07-04 13:02:14', '2020-07-25 06:37:34'),
