(261, 144, NULL, 'ORGANIC COTTON', '<p class=\"MsoNoSpacing\" style=\"text-align: justify;\"><font face=\"Times New Roman, serif\"><span style=\"font-weight: bolder;\">ORGANIC COTTON- Digital</span></font></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: rgb(34, 34, 34);\">Want to look cool and casual for the upcoming season? So why not be ready in Rutbah’s&nbsp; 24/7 Organic Cotton Collection. It is no less than a game of hide-n-seek between the warps and wefts, giving the regular cotton fabric a distinct and beautiful look &amp; feel. Soaked in earthy hues, the collection comes in a traditional assortment of designs like flowers, leaves, stripes, chevrons to name a few. Design Your Own casual Cotton Textured suits, kurtas, blouses, rompers, skirts, dhoti pants, overlays &amp; more!<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: rgb(34, 34, 34);\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 12pt; font-family: Arial, sans-serif; color: rgb(34, 34, 34);\">Product Type:&nbsp; Unstitched.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: norm