(275, 161, '', 'CHANDERI COTTON KURTI FIT', '<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\"><span style=\"font-weight: bolder;\">CHANDERI COTTON SUIT&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\"><span style=\"font-weight: bolder;\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\">Rutbah’s&nbsp; Plain Chanderi collection is skillfully woven from&nbsp; Chanderi cotton where each warp and weft is dipped and dyed in an array of solid colors with cross stitched embroidery. Weighing around 70 gms per meter, this soft, sheer and lightweight plain Chanderi fabric with exclusive cross stitch butterfly embroidery perfect for all&nbsp; occasions. And on its own can be designed into a beautiful suit u wish to wear casually or formally</p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\">Product Type:&nbsp; Unstitched.</p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\">Fabric:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Chanderi</p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\">Shirt -&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2.5 meters&nbsp;</p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\">Bottom -&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3 meters</p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\">Dupatta -&nbsp; &nbsp; &nbsp; &nbsp; Chanderi Cotton Embroided&nbsp; Dupatta&nbsp;</p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\">Occasion:&nbsp; &nbsp; &nbsp; &nbsp; Casual.</p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\">Wash care:&nbsp; &nbsp; &nbsp; Dry Clean Only&nbsp;&nbsp;</p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\">Disclaimer: Colors of the product might appear slightly different on digital devices.</p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\">We deal into unstitched suits and actual colors may vary and model picture mentioned is just for the reference.</p><div><br></div><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: normal;\"><br></p>', 86, 90, 93, 99, NULL, 'https://drive.google.com/uc?export=view&id=1lNQ2UeHmo8NdcALdDYwbyjuI8OqF6sEF', 'https://drive.google.com/uc?export=view&id=1uA7aeoskQk0RXmx6ADcJYSLChm-HI5Y3', NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 1, 1, NULL, '2020-07-31 04:15:20', '2020-10-05 08:42:28'),
