(301, 177, '', 'PURE KOTA COTTON-OFFWHITE AND PINK', '<p><span style=\"font-weight: bolder;\">PURE KOTA COTTON-OFFWHITE AND PINK</span></p><p><span style=\"font-weight: bolder;\">&nbsp; &nbsp;</span>Rutbas’s Kota Cotton&nbsp; Collection from Thread Edits displays a colorful play of tie &amp; dye patterns and foil prints in designs of abstracts, florals and ornamental objects. These fabrics are finely interweaved to make Khats – check dupatta patterns with scapled embroidery.Hence&nbsp; giving the fabric an airy and feather-light texture. Its lightweight and sheer nature makes it a perfect pick for, suits (with astar), dupattas, skirts and more.</p><p><br></p><p>Product Type:&nbsp; Unstitched.</p><p>Fabric:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Kota Cotton</p><p>Shirt -&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2.5 meters&nbsp;</p><p>Bottom -&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 3 meters</p><p>Dupatta -&nbsp; &nbsp; &nbsp; &nbsp; Kota check Dupatta&nbsp; Embroided&nbsp; and scalped.</p><p>Occasion:&nbsp; &nbsp; &nbsp; &nbsp; Casual.</p><p>Wash care:&nbsp; &nbsp; &nbsp; Gentle Handwash.&nbsp;</p><p>Disclaimer: Colors of the product might appear slightly different on digital devices.</p><p>We deal into unstitched suits and actual colors may vary and model picture mentioned is just for the reference.</p>', 95, 90, 93, 99, NULL, 'https://drive.google.com/uc?export=view&id=1-DR5abLSRx3NUE_G6WZPRLn7N35cM7jU', 'https://drive.google.com/uc?export=view&id=1mevAn-5k_AdL5rGGcvpydVC8AgTCnlb5', NULL, NULL, NULL, NULL, NULL, NULL, 0, 4, 1, 1, NULL, '2020-08-06 14:31:07', '2020-10-05 09:34:51'),
